import React from "react";
import Layout from "../components/layout";
import TabsWrap from "../components/profile/tabs";

const Profile = () => {
  return (
    <React.Fragment>
      <Layout>
        <div className="h-screen">
          <h1>Profile Page</h1>
        </div>
      </Layout>
    </React.Fragment>
  );
};

export default Profile;
